import React, {Component} from 'react';
import Aux from '../hoc/Auxiliary';
import Navbar from './static-comps/Navbar';
import Footer from './static-comps/footer';

class SupportPage extends Component
{
    render(){
        return(
            <Aux>
                <Navbar />
                <Footer />
            </Aux>
        );
    }

}

export default SupportPage;
